import React from 'react';
import TeamMember from './TeamMember';

function Team(){


    return(
        <div className='row'>
            <TeamMember 
                info={
                    {
                        img: '/path-to-image',
                        name: 'Raghad Alahmadi',
                        position: 'Programmer',
                        phone: '+123 456 789',
                        email: 'raghad@gmail.com',
                        website: 'www.raghadalahmadi.com',
                    }
                }
            
            
            name='Raghad'/>
            <TeamMember name='Ahmad'/>
            <TeamMember name='Yassin'/>
        </div>

    );
}

export default Team;
